<noscript>You need to enable JavaScript to run this app.</noscript>
<div id="root" style="display: none"></div>
<script src="./render-formula.js?random=17"></script>
<script>function getParameterByName(name, url = window.location.href) {
    name = name.replace(/[\[\]]/g, '\\$&');
    var regex = new RegExp('[?&]' + name + '(=([^&#]*)|&|#|$)'),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, ' '));
}</script>
<div style="height:82%" id="image" onclick="window.parent.ChemExtension.navigate(getParameterByName('chemformid'), getParameterByName('isreaction'));"></div>
